import React from "react";
import { Link } from "react-router-dom";

import Avatar from "../../shared/Avatar";

function Logo({ prof }) {
  var logoMomo =
    "https://www.cmontmorency.qc.ca/wp-content/themes/axial/images/logo.png";

  return (
    <React.Fragment>
      <Link to={`/${prof.id}/places`}>
        <div className="logo-montmorency">
          <Avatar image={logoMomo} alt={"Logo montmorency"} />
        </div>
      </Link>
    </React.Fragment>
  );
}

export default Logo;
